import React, { useState, useEffect } from 'react';
import { HashRouter as Router, Route, Routes } from 'react-router-dom';
import Preloader from './components/Preloader';
import Home from './pages/Home';
import Contact from './pages/Contact';
import Footer from './components/Footer';
import Navbar from './components/Navbar';
import About from './pages/About';
import Events from './pages/Events';
import CurrentTeam from './pages/CurrentTeam';
import PastTeam from './pages/PastTeam';
import Clubs from './pages/Clubs';
import PlacementTalksVideos from './pages/PlacementTalksVideos';
import Blogs from './pages/Blogs';
import EventsDetails from './pages/EventsDetails';
import BlogsDetails from './pages/BlogsDetails';
import PrepMat from './pages/PrepMat';
import Material from './pages/Material';
import ClubsDetails from './pages/ClubsDetails';

const App = () => {
  const [loading, setLoading] = useState(true);
  useEffect(() => {
      setTimeout(() => {
          setLoading(false);
      }, 2000);
  }, []);
  return (
    <div>
    {loading ? <Preloader /> :
        <Router>
            {/* <NavBar /> */}
            <Navigation/>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/grants-and-funds" element={<GrantsAndFunds />} />
                <Route path="/data" element={<Data />} />
                <Route path="/people" element={<PeoplesPage />} />
                <Route path="/people/:Name" element={<PeopleDetails />} />



                <Route path="/research" element={<ResearchArea />} />
                <Route path="/research/:PageLink" element={<ResearchAreaDetails />} />

                <Route path="/publications" element={<Publications />} />
                <Route path="/publications/journal-articles" element={<JournalArticles />} />
                <Route path="/publications/books-expository-and-review-articles" element={<BooksChaptersReviewArticles />} />
                <Route path="/publications/invited-papers" element={<InvitedPapers />} />
                <Route path="/publications/conference-presentations" element={<ConferencePresentations />} />



                <Route path="/news" element={<News />} />
                <Route path="/contact" element={<Contact />} />
                <Route path="/disclaimer" element={<Disclaimer />} />
                <Route path="/privacy-policy" element={<PrivacyPolicy />} />




                <Route path="/data-portals" element={<Geoportals />} />
                <Route path="/people/current" element={<CurrentMemberPage />} />
                <Route path="/people/alumni" element={<AlumniPage />} />
                <Route path="/people/interns" element={<InternsPage />} />
                <Route path="/people/gallery" element={<PeopleGallery />} />
            </Routes>
            <ScrollToTopButton />
            <Footer />
        </Router>
    }
</div>


  )
}

export default App
